import React, { useState, useEffect } from 'react';
import Canvas from './Canvas';
import axios from 'axios';

const PRESET_ROLES = [
  { role: 'Ëá™Â∑±', icon: 'üßë' },
  { role: 'Áà∂‰∫≤', icon: 'üë®' },
  { role: 'ÊØç‰∫≤', icon: 'üë©' },
  { role: 'Â≠©Â≠ê', icon: 'üßí' },
  { role: 'Á•ñÁà∂', icon: 'üë¥' },
  { role: 'Á•ñÊØç', icon: 'üëµ' },
  { role: 'ÈÖçÂÅ∂', icon: 'üíë' },
  { role: 'Âì•Âì•', icon: 'üßë‚Äçü¶±' },
  { role: 'ÂßêÂßê', icon: 'üë©‚Äçü¶∞' },
  { role: 'ÂºüÂºü', icon: 'üßë‚Äçüéì' },
  { role: 'Â¶πÂ¶π', icon: 'üëß' },
  { role: 'ÂÑøÂ≠ê', icon: 'üë¶' },
  { role: 'Â•≥ÂÑø', icon: 'üëß' },
  { role: 'ÁªßÁà∂', icon: 'üßî' },
  { role: 'ÁªßÊØç', icon: 'üë©‚Äçü¶≥' },
  { role: 'ÂÖªÁà∂', icon: 'üßì' },
  { role: 'ÂÖªÊØç', icon: 'üëµ' },
  { role: 'ÊúãÂèã', icon: 'ü§ù' },
  { role: 'ÂÆ†Áâ©', icon: 'üê∂' },
];

export default function App() {
  const [members, setMembers] = useState(() => {
    const saved = localStorage.getItem('members');
    return saved ? JSON.parse(saved) : [];
  });
  const [name, setName] = useState('');
  const [role, setRole] = useState('');
  const [icon, setIcon] = useState('üßë');
  const [analysis, setAnalysis] = useState('');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    localStorage.setItem('members', JSON.stringify(members));
  }, [members]);

  const addMember = () => {
    if (!name || !role) return;
    setMembers([...members, { id: Date.now(), name, role, icon, x: 100, y: 100 }]);
    setName('');
    setRole('');
    setIcon('üßë');
  };

  const quickAdd = preset => {
    setRole(preset.role);
    setIcon(preset.icon);
    setName('');
  };

  const updateMemberPosition = (id, x, y) => {
    setMembers(members.map(m => (m.id === id ? { ...m, x, y } : m)));
  };

  const generateDescription = () => {
    return members.map(m => `${m.name}Ôºà${m.role}Ôºâ‰Ωç‰∫é(${m.x}, ${m.y})`).join('Ôºå');
  };

  const analyze = async () => {
    setLoading(true);
    setAnalysis('');
    try {
      const description = generateDescription();
      const res = await axios.post('http://127.0.0.1:5000/analyze', { description });
      setAnalysis(res.data.analysis);
    } catch {
      setAnalysis('‚ö†Ô∏è ÂàÜÊûêÂ§±Ë¥•ÔºåËØ∑Á®çÂêéÈáçËØï„ÄÇ');
    }
    setLoading(false);
  };

  const clearMembers = () => {
    setMembers([]);
    setAnalysis('');
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-blue-100 py-6 px-4 sm:px-6">
      <div className="max-w-4xl mx-auto bg-white rounded-3xl shadow-2xl p-6 sm:p-10 border border-blue-100">
        <h1 className="text-4xl font-bold text-blue-700 text-center mb-6 drop-shadow-sm">üåü ÂÆ∂Â∫≠ÊàêÂëòÊéíÂàóÂàÜÊûê</h1>

        {/* Âø´ÈÄüÊ∑ªÂä†ÊåâÈíÆ */}
        <div className="flex flex-wrap justify-center gap-2 mb-5">
          {PRESET_ROLES.map(preset => (
            <button
              key={preset.role}
              onClick={() => quickAdd(preset)}
              className="bg-blue-100 hover:bg-blue-300 text-blue-800 px-3 py-1 rounded-xl font-medium flex items-center gap-1 border border-blue-200 transition-all duration-150 shadow-sm hover:scale-105"
            >
              <span className="text-xl">{preset.icon}</span>{preset.role}
            </button>
          ))}
        </div>

        {/* ËæìÂÖ•Ë°®ÂçïÂå∫Âüü */}
        <div className="flex flex-wrap gap-4 items-center justify-center mb-6">
          <input
            className="border-2 border-blue-200 p-3 text-lg rounded-lg w-full sm:w-52 focus:outline-none focus:border-blue-400 transition"
            placeholder="ÂßìÂêç"
            value={name}
            onChange={e => setName(e.target.value)}
          />
          <input
            className="border-2 border-blue-200 p-3 text-lg rounded-lg w-full sm:w-52 focus:outline-none focus:border-blue-400 transition"
            placeholder="ÂÖ≥Á≥ª"
            value={role}
            onChange={e => setRole(e.target.value)}
          />
          <select
            className="border-2 border-blue-200 p-3 text-2xl rounded-lg focus:outline-none focus:border-blue-400 transition"
            value={icon}
            onChange={e => setIcon(e.target.value)}
          >
            {PRESET_ROLES.map(preset => (
              <option key={preset.role} value={preset.icon}>{preset.icon}</option>
            ))}
          </select>
          <button
            onClick={addMember}
            className="bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-xl font-semibold shadow-md transition-all hover:scale-105"
          >
            Ê∑ªÂä†
          </button>
        </div>

        {/* ÊãñÊãΩÁîªÂ∏É */}
        <Canvas members={members} updateMemberPosition={updateMemberPosition} />

        {/* Êìç‰ΩúÊåâÈíÆ */}
        <div className="flex justify-center gap-4 mt-4">
          <button
            onClick={analyze}
            disabled={loading || members.length === 0}
            className={`px-8 py-3 font-bold rounded-xl shadow-md transition-all ${
              loading || members.length === 0
                ? 'bg-gray-300 text-gray-600 cursor-not-allowed'
                : 'bg-gradient-to-r from-green-400 to-blue-500 hover:from-green-500 hover:to-blue-600 text-white hover:scale-105'
            }`}
          >
            {loading ? 'ÂàÜÊûê‰∏≠...' : 'üîç ÂºÄÂßãÂàÜÊûê'}
          </button>
          <button
            onClick={clearMembers}
            disabled={members.length === 0}
            className="bg-white border border-gray-300 text-gray-700 px-6 py-2 rounded-xl font-medium shadow-sm hover:bg-gray-100 transition hover:scale-105 disabled:opacity-50"
          >
            üßπ Ê∏ÖÁ©∫
          </button>
        </div>

        {/* ÂàÜÊûêÁªìÊûúÂ±ïÁ§∫ */}
        {analysis && (
          <div className="mt-10 p-6 bg-blue-50 border border-blue-200 rounded-2xl shadow-inner">
            <div className="text-lg font-bold text-blue-700 mb-3">üß† ÂàÜÊûêÁªìÊûúÔºö</div>
            <div className="text-gray-800 leading-relaxed whitespace-pre-line">
              {analysis}
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
